import React, {useState} from "react";
import {Container, Card, Button, Row, Col} from "react-bootstrap";

function Portfolio(){

    const [work] = useState([
        {
            name: 'Gopher',
            id: 'Gopher-Img-Element',
            description: 'Node.js, etc',
            link: 'https://github.com/lrk83',
        }
    ])

    return(
        <div>
            <Container>
                <Row>
                    <Col>
                {work.map((example, i)=>(
                    <Card style={{ width: '18rem' }} key={example.name} id={example.id}>
                        <Card.Body >
                        <Card.Text>
                            {example.description}
                        </Card.Text>
                        <Button variant="primary" href={example.link}>{example.name}</Button>
                        </Card.Body>
                    </Card>
                ))}
                </Col>
                </Row>
            </Container>
        </div>
    )
}

export default Portfolio;
